// recursive function working as loop
function AddDcument() {
  cy.get("#case-navigationpanel-2 > section > div > div > button > span.MuiIconButton-label > svg").click();
  cy.get('.MuiList-root > [tabindex="0"]').click();
  cy.get("#modal").then($element => {
    const elementText = $element.text();
    if (elementText.includes("There are no more documents left to add.")) {
      cy.get('button[data-title="close-button"]').click();
      return;
    } else {
      //open dropdown to add document types
      cy.get("#mui-component-select-fileType").click();
      cy.get("#menu-fileType > div.MuiPaper-root.MuiMenu-paper.MuiPopover-paper.MuiPaper-elevation8.MuiPaper-rounded > ul > li:nth-child(1)").click();
      cy.get("button.MuiButtonBase-root.MuiButton-root.MuiButton-text.MuiButton-textPrimary").click();
      cy.wait(3000);
    }
    AddDcument(); // Call the function again for the next iteration
  });
}
